;; <=

;; **
;;; Now, let us show the population of all models we have trained, over a scatter plot. One axis shows the mean square error on the training set, and the other - on the test set.
;; **

;; @@
(->> models-compared
     (mapcat (fn [model-results]
 	           (->> model-results
    	             :results
        	         (map :mean-square-error))))
  	 (apply max))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>0.3250375</span>","value":"0.3250375"}
;; <=

;; @@
(let [max-mean-square-error (->> models-compared
                                 (mapcat (fn [model-results]
 	           						(->> model-results
    	             					:results
        	         					(map :mean-square-error))))
  	 							 (apply max))]
   (->> models-compared
     (group-by (fn [model-results]
                 (-> model-results 
                   	 :training-parameters 
                     :model-type)))
     (map (fn [[model-type models-results]]
             (plot/list-plot
                  (->> models-results
                       (map (fn [model-results]
                         (->> model-results
                              :results
                              (map :mean-square-error)))))
                  :x-title :training-mean-square-error
                  :y-title :test-mean-square-error
                  :color (case model-type
                           :tree "green"
                           :forest "brown")
              	  :opacity 0.3
              	  :plot-range [[0 max-mean-square-error]
                               [0 max-mean-square-error]])))
      (apply plot/compose)))
     
